const Nav = prop =>{
    const topicList = prop.map((topic)=>{
        <li>
            <a href="/read/">{topic.title}</a>
        </li>
    });

    return(
       <ol>
        {topicList}
        {console.log(topicList)}
       </ol>
    );   
}

export default Nav;
